function getDataUrl(img) {
    // Create canvas
    const canvas = document.createElement('canvas');
    const ctx = canvas.getContext('2d');
    // Set width and height
    canvas.width = img.width;
    canvas.height = img.height;
    // Draw the image
    ctx.drawImage(img, 0, 0);
    return canvas.toDataURL('image/jpeg');
 }

function srcBase64(elem){
    elem = elem.cloneNode(true);
    for(let img of elem.querySelectorAll('img'))
        img.src = getDataUrl(img)
    return elem

}

function cleanQtext(qtext){ 
    clone=qtext.cloneNode(true)
    children = [...clone.querySelectorAll('*')]
    children.push(clone)
    for(let elem of children){
            [...elem.attributes].forEach(attr => {
                if(!(elem.nodeName === "IMG" && attr.name === "src"))
                    elem.removeAttribute(attr.name)
                else
                    elem.src = getDataUrl(elem)
                
    });
        
    }
    for(let br of clone.querySelectorAll('br')){
        br.remove()
    }
    cloneHTML = clone.outerHTML
    cloneHTML = cloneHTML.replace('\t','')
    cloneHTML = cloneHTML.replace('\n','')
    return cloneHTML;
}
